function GroupAmount()
  ga=1
  local x=1  
  groups={} 
  repeat
     local handle=o.handle('22.1.'..x)
     if(handle) then
       local gn=property(handle,'No.')
       table.insert(groups,gn) 
       ga=ga+1
       gama=ga+2 
     end      
  x=x+1  
  until(handle==nil)
gama=ga+1 
  images() 
end

