function presets()
   ga=ga-2
   local g=1
   local col=1
   local pn=100
   if con('ATENÇÃO! ATTENTION! ','AS PREDEFINIÇÕES DE CORES DE 100 A 112 SERAM EXCLUIDAS') then
      cmd('Delete preset 4.100 thru 4.112/ nc')
      for ga=1,ga,1 do
         for col=1,4,1 do
            cmd('Group '..groups[g])
            cmd('PresetType Color')
            cmd('at Gel 12.'..col)
            cmd('Store Preset 4.'..pn..'/m')
            cmd('ClearAll')            
            pn=pn+1
         end
       
         for col=6,8,1 do
            cmd('Group '..groups[g])
            cmd('PresetType Color')
            cmd('at Gel 12.'..col)
            cmd('Store Preset 4.'..pn..'/m')
            cmd('ClearAll')            
            pn=pn+1
         end
            cmd('Group '..groups[g])
            cmd('PresetType Color')
            cmd('at Gel 12.10')
            cmd('Store Preset 4.'..pn..'/m')
            cmd('ClearAll')            
            pn=pn+1
            cmd('Group '..groups[g])
            cmd('PresetType Color')
            cmd('at Gel 12.9')
            cmd('Store Preset 4.'..pn..'/m')
            cmd('ClearAll')            
            pn=pn+1
            for col=11,13,1 do
            cmd('Group '..groups[g])
            cmd('PresetType Color')
            cmd('at Gel 12.'..col)
            cmd('Store Preset 4.'..pn..'/m')
            cmd('ClearAll')            
            pn=pn+1
           end 
         g=g+1
         pn=100
         
      end
   sequencees()
   else
      return
   end
   
end

function sequencees()
   local g=1   
   local gam=ga-1
   local x=1
   if con('ATENÇÃO! ATTENTION!','VOCÊ DEVE ESCOLHER UM EXECUTOR BULTTON VAZIO PARA AS SEQUENCIAS DE CORES. \n DESTE '..gam..' OS EXECUTORES SERAM ARMAZENADOS.') then
      page=tonumber(text('PAGINA PARA AS SEQUENCIAS','DIGITE O NUMERO DA PAGINA PARA SEQUENCIAS'))
      local startseq=tonumber(text('QUAL EXECUTOR OU BULTTON','EXEMPLO. 101 '))
      seq=startseq
      fseq=seq
      maseq=seq
      local www=1003
      if (startseq ~=nil) and (page ~=nil) then
        for x=1,ga,1 do
           cmd('Delete seq '..www..' /nc')
           local c=1
           local handle=o.handle('22.1.'..x)
           local gname=property(handle,'Name')
           if(handle) then 
              for col=1,11,1 do
                 local handle=o.handle('17.1.4.'..col)
                 local presetname=property(handle,'Name') 
                 cmd('Group '..groups[g])                 
                 cmd('at Preset 4.'..col)
                 cmd('Store seq '..www..' cue '..c..'/m')                 
                 cmd('ClearAll')                           
                 c=c+1 
              end
              cmd('assign seq '..www..' at exec '..page..'.'..startseq)
              cmd('Label exec '..page..'.'..startseq..' "'..gname..'"/nc')               
           end
         g=g+1
         www=www+1
         startseq=startseq+1 
         end
         
      colormacros() 
      else
        if con('Invalid Value!','Input must be a number') then
         sequencees()
        else
           return
        end 
      end
   end
end

function colormacros()
   gama=gama*16
   local ian=ia+ga  --Anzahl Macros für info sheet    
   local imfilen=imfilst+11  --image filled end number
   local imunfst=imfilen+5  --image unfilled start number
   local imunfen=imunfst+11  --image unfilled end number
   local maimst=imunfen+5  --first image number for macros
   local maaa=maimst 
   local maimsta=maimst 
